var tipuesearch = {"pages": [{'title': 'Introduction', 'text': '組員: \n 40623201  王君庭 \n 40623204  張晏晴 \n 40623217  楊傅博\xa0\xa0 \n 40623223  任明彥 \n 40623229  陳宥安 \n 40623232  余建杰 \n 40623242  高宇辰 \n 40623243  盧逸誠 \n 40623244  林俊鎧 \n 40623248  廖柏誠 \n 40423220  林易寬 \n 本倉儲位於: https://github.com/mdekmol/cd2019b-task1-2019cdb_t1_g5 \n onshape : 手足球 \n', 'tags': '', 'url': 'Introduction.html'}, {'title': 'Attent & Absence', 'text': '出席● \n 缺席○ \n 遲到◎ \n 早退▲ \n \n \n \n \n week10 \n week11 \n week12 \n week13 \n week14 \n week15 \n week16 \n week17 \n week18 \n \n \n 40623201 \n ● \n \n \n \n \n \n \n \n \n \n \n 40623204 \n ● \n \n \n \n \n \n \n \n \n \n \n 40623217 \n ● \n \n \n \n \n \n \n \n \n \n \n 40623223 \n ● \n \n \n \n \n \n \n \n \n \n \n 40623229 \n ▲ \n \n \n \n \n \n \n \n \n \n \n 40623232 \n ● \n \n \n \n \n \n \n \n \n \n \n 40623242 \n ● \n \n \n \n \n \n \n \n \n \n \n 40623243 \n ○ \n \n \n \n \n \n \n \n \n \n \n 40623244 \n ● \n \n \n \n \n \n \n \n \n \n \n 40623248 \n ● \n \n \n \n \n \n \n \n \n \n \n 40423220 \n ○ \n \n \n \n \n \n \n \n \n \n \n \n', 'tags': '', 'url': 'Attent & Absence.html'}, {'title': 'Course content', 'text': 'week1 \n week2 \n week3 \n week4 \n week5 \n week6 \n week7 \n', 'tags': '', 'url': 'Course content.html'}, {'title': 'week1', 'text': '上課內容：建立 Windows 64 位元可攜程式系統。 \n 1.下載  Python 3.7.2，選擇\xa0\xa0 Windows x86-64 executable installer \xa0。 \n \n \n \n 2.安裝 Python 。 \n \n \n \n \n 3.下載  HxD \xa0。 \n \n 4.打開 HxD 後，更改 pip 。 \n \n \n \n 5.下載  SciTE \xa0。 \n \n \n 6.修改 code.page 使中文可在 SciTE上顯示。 \n \n \n \n 7.下載\xa0 KDiff \xa0(用來比較差異性的工具)。 \n \n \n 8.下載  TCC \xa0(Tiny C Compiler)。 \n \n 9.修改 start.bat 及 stop.bat。 \n \n', 'tags': '', 'url': 'week1.html'}, {'title': 'week2', 'text': '\n', 'tags': '', 'url': 'week2.html'}, {'title': 'week3', 'text': '上課內容: \n 如何使用 ungit 進行檔案推送及版本的推還確認 \n 1.先在y的home內部進行user config綁定 \n \n \n 2.到python wsgi.py動態網站更改部分的資料 \n 3.接著開啟ungit後進行commit上傳 \n \n 4.上傳後再push即可更改成功 \n \n 5.到warehousing尋找commit recond \n \n 如何運用ungit回推版本: \n 1.先開啟ungit，並將某一個歷程編上tag \n \n 2.使用指令 git checkout 到所要的歷程，如下圖是到expw4-18，再開啟python wsgi.py確定是否回歸到版本。 \n \n 3.接著回到當前版本需要使用指令 git checkout -- config/content.htm ， 接著用git checkout delprogress回到當前版本。 \n \n 4.再次回到python wsgi.py內察看是否回到當前版本 \n \n', 'tags': '', 'url': 'week3.html'}, {'title': 'week4', 'text': '上課內容： 在可攜程式系統中加上 ungit 、利 用 ssh 與 private key 對 Github 倉儲提交推送 。 \n 1.下載\xa0 cdb w4 版本.7z \xa0+\xa0 nodejs_with_ungit.7z ， ( ungit 設定說明 ) 。 \n \n 2.解壓縮後將 nodejs 放到\xa0cd2019_cdb_w4 的 y 內。 \n \n 3.更改 start.bat 路徑，可參考 ungit 設定說明 \xa0。 \n \n 4. clone  cmstest  的倉儲。 \n \n 5.設定 kungit 。 \n \n 6.\xa0打指令 kungit 。 \n \n \n \n \n', 'tags': '', 'url': 'week4.html'}, {'title': 'week5', 'text': '上課內容： \n bubbleRob V-rep 模擬。 \n \n \n \n', 'tags': '', 'url': 'week5.html'}, {'title': 'week6', 'text': '上課內容： \n bubbleRob V-rep 模擬，延續上周部分。 \n \n \n \n BubbleRob File： Download \n', 'tags': '', 'url': 'week6.html'}, {'title': 'week7', 'text': '\n', 'tags': '', 'url': 'week7.html'}, {'title': 'week8', 'text': '上課內容: \n 說明協同產品設計流程的教育目標、Building a clean model V-rep 模擬。 \n \n \n', 'tags': '', 'url': 'week8.html'}, {'title': 'week9', 'text': '期中考週： \n 1.學員期中報告影片錄製。 \n 2.影片標題與說明。 \n 3.學員填寫自評表單。 \n 4.個人期中報告影片嵌入網頁。 \n 5.學員口頭期中報告。 \n', 'tags': '', 'url': 'week9.html'}, {'title': 'week10', 'text': '\n \n \n', 'tags': '', 'url': 'week10.html'}, {'title': 'Git http&SSH', 'text': '利用 ssh 對 git 改版, 必須使用\xa0 home/.ssh/config 設定, 才能透過 proxy 伺服器進行連線, 由於在 IPv6 環境下, 必須要透過 proxy 才能對 Git 連線, 因此若無 config, 無法對遠端改版 \n', 'tags': '', 'url': 'Git http&SSH.html'}, {'title': 'Preceding operation', 'text': 'Directory structure \n Page editing \n Insert program \n Internet newsletter \n Pelican edit \n', 'tags': '', 'url': 'Preceding operation.html'}, {'title': 'Directory structure', 'text': '第二位想要編輯這裡 \n \n CMSimfly 的動態系統採用 Python3 + Flask 建構, 並且利用 Beatifulsoup 解讀位於 contig 目錄中的 content.htm 超文件檔案. \n content.htm 檔案可以透過動態系統中的 generate_pages 功能, 將超文件轉為位於 content 目錄中的個別頁面檔案. \n 動態系統與靜態系統則共用 downloads, images, static 等目錄, 其中 downloads 目錄存放在動態系統上傳的文件檔, 而 images 目錄則存放動態系統所上傳的影像檔案, 包括 jpg, png 與 gif 等格式圖檔. \n static 目錄則存放在動態與靜態系統所需要的 Javascript 或 Brython 程式檔. \n 還有這裡 \n 首先修改這裡 \n', 'tags': '', 'url': 'Directory structure.html'}, {'title': 'Page editing', 'text': 'CMSimfly 動態系統的網際編輯器採用  TinyMCE4 , 可以放入一般超文件,\xa0 納入圖檔, 嵌入影片連結, 並且加入帶有行數的原始碼. \n 透過 File Upload 功能, 可以一次上傳多個檔案,\xa0 存入 downloads 目錄中儲存, 之後各頁面可以引入對應連結. \n 而圖檔的上傳與引用與一般檔案類似, 但上傳後存入 images 目錄中. \n', 'tags': '', 'url': 'Page editing.html'}, {'title': 'Insert program', 'text': 'CMSimfly 目前使用 Syntaxhighlighter 3.0.83: \n \xa0 http://alexgorbatchev.com/SyntaxHighlighter/ \xa0 \n 進行頁面中的程式碼高亮顯示. \n \n Java\xa0 program \n import java.util.Scanner;\n\npublic class Life {\n    public static void show(boolean[][] grid){\n        String s = "";\n        for(boolean[] row : grid){\n            for(boolean val : row)\n                if(val)\n                    s += "*";\n                else\n                    s += ".";\n            s += "\\n";\n        }\n        System.out.println(s);\n    }\n    \n    public static boolean[][] gen(){\n        boolean[][] grid = new boolean[10][10];\n        for(int r = 0; r < 10; r++)\n            for(int c = 0; c < 10; c++)\n                if( Math.random() > 0.7 )\n                    grid[r][c] = true;\n        return grid;\n    }\n    \n    public static void main(String[] args){\n        boolean[][] world = gen();\n        show(world);\n        System.out.println();\n        world = nextGen(world);\n        show(world);\n        Scanner s = new Scanner(System.in);\n        while(s.nextLine().length() == 0){\n            System.out.println();\n            world = nextGen(world);\n            show(world);\n            \n        }\n    }\n    \n    public static boolean[][] nextGen(boolean[][] world){\n        boolean[][] newWorld \n            = new boolean[world.length][world[0].length];\n        int num;\n        for(int r = 0; r < world.length; r++){\n            for(int c = 0; c < world[0].length; c++){\n                num = numNeighbors(world, r, c);\n                if( occupiedNext(num, world[r][c]) )\n                    newWorld[r][c] = true;\n            }\n        }\n        return newWorld;\n    }\n    \n    public static boolean occupiedNext(int numNeighbors, boolean occupied){\n        if( occupied && (numNeighbors == 2 || numNeighbors == 3))\n            return true;\n        else if (!occupied && numNeighbors == 3)\n            return true;\n        else\n            return false;\n    }\n\n    private static int numNeighbors(boolean[][] world, int row, int col) {\n        int num = world[row][col] ? -1 : 0;\n        for(int r = row - 1; r <= row + 1; r++)\n            for(int c = col - 1; c <= col + 1; c++)\n                if( inbounds(world, r, c) && world[r][c] )\n                    num++;\n\n        return num;\n    }\n\n    private static boolean inbounds(boolean[][] world, int r, int c) {\n        return r >= 0 && r < world.length && c >= 0 &&\n        c < world[0].length;\n    }\n\n} \n \n \n Python\xa0 program \n def parse_content():\n    """use bs4 and re module functions to parse content.htm"""\n    #from pybean import Store, SQLiteWriter\n    # if no content.db, create database file with cms table\n    \'\'\'\n    if not os.path.isfile(config_dir+"content.db"):\n        library = Store(SQLiteWriter(config_dir+"content.db", frozen=False))\n        cms = library.new("cms")\n        cms.follow = 0\n        cms.title = "head 1"\n        cms.content = "content 1"\n        cms.memo = "first memo"\n        library.save(cms)\n        library.commit()\n    \'\'\'\n    # if no content.htm, generate a head 1 and content 1 file\n    if not os.path.isfile(config_dir+"content.htm"):\n        # create content.htm if there is no content.htm\n        File = open(config_dir + "content.htm", "w", encoding="utf-8")\n        File.write("<h1>head 1</h1>content 1")\n        File.close()\n    subject = file_get_contents(config_dir+"content.htm")\n    # deal with content without content\n    if subject == "":\n        # create content.htm if there is no content.htm\n        File = open(config_dir + "content.htm", "w", encoding="utf-8")\n        File.write("<h1>head 1</h1>content 1")\n        File.close()\n        subject = "<h1>head 1</h1>content 1"\n    # initialize the return lists\n    head_list = []\n    level_list = []\n    page_list = []\n    # make the soup out of the html content\n    soup = bs4.BeautifulSoup(subject, \'html.parser\')\n    # 嘗試解讀各種情況下的標題\n    soup = _remove_h123_attrs(soup)\n    # 改寫 content.htm 後重新取 subject\n    with open(config_dir + "content.htm", "wb") as f:\n        f.write(soup.encode("utf-8"))\n    subject = file_get_contents(config_dir+"content.htm")\n    # get all h1, h2, h3 tags into list\n    htag= soup.find_all([\'h1\', \'h2\', \'h3\'])\n    n = len(htag)\n    # get the page content to split subject using each h tag\n    temp_data = subject.split(str(htag[0]))\n    if len(temp_data) > 2:\n        subject = str(htag[0]).join(temp_data[1:])\n    else:\n        subject = temp_data[1]\n    if n >1:\n            # i from 1 to i-1\n            for i in range(1, len(htag)):\n                head_list.append(htag[i-1].text.strip())\n                # use name attribute of h* tag to get h1, h2 or h3\n                # the number of h1, h2 or h3 is the level of page menu\n                level_list.append(htag[i-1].name[1])\n                temp_data = subject.split(str(htag[i]))\n                if len(temp_data) > 2:\n                    subject = str(htag[i]).join(temp_data[1:])\n                else:\n                    subject = temp_data[1]\n                # cut the other page content out of htag from 1 to i-1\n                cut = temp_data[0]\n                # add the page content\n                page_list.append(cut)\n    # last i\n    # add the last page title\n    head_list.append(htag[n-1].text.strip())\n    # add the last level\n    level_list.append(htag[n-1].name[1])\n    temp_data = subject.split(str(htag[n-1]))\n    # the last subject\n    subject = temp_data[0]\n    # cut the last page content out\n    cut = temp_data[0]\n    # the last page content\n    page_list.append(cut)\n    return head_list, level_list, page_list\n\n \n \n \n C或C++\xa0 program \n 請注意, 目前 CMSimfly 標題內文無法解讀 "/" 符號, 因此若本頁面的標題為\xa0 "C/C++程式碼", 則無法進行分頁. \n /* Runge Kutta for a set of first order differential equations */\n \n#include <stdio.h>\n#include <math.h>\n \n#define N 2 /* number of first order equations */\n#define dist 0.1 /* stepsize in t*/\n#define MAX 30.0 /* max for t */\n \nFILE *output; /* internal filename */\nFILE *output1; /* internal filename */\n// 利用 pipe 呼叫 gnuplot 繪圖\nFILE *pipe;\n \nvoid runge4(double x, double y[], double step); /* Runge-Kutta function */\ndouble f(double x, double y[], int i); /* function for derivatives */\n \nvoid main(){\n \n  double t, y[N];\n  int j;\n \n  output=fopen("osc.dat", "w"); /* external filename */\n  output1=fopen("osc1.dat", "w"); /* external filename */\n \n  y[0]=1.0; /* initial position */\n  y[1]=0.0; /* initial velocity */\n \n  //fprintf(output, "0\\t%f\\n", y[0]);\n \n  for (j=1; j*dist<=MAX ;j++) /* time loop */{\n \n    t=j*dist;\n    runge4(t, y, dist);\n    fprintf(output, "%f\\t%f\\n", t, y[0]);\n    fprintf(output1, "%f\\t%f\\n", t, y[1]);\n  }\n \n  fclose(output);\n  fclose(output1);\n \n  pipe = popen("gnuplot -persist","w");\n  //fprintf(pipe,"set term png enhanced font \\"v:/fireflysung.ttf\\" 18 \\n");\n  fprintf(pipe,"set term png enhanced font \\"y:/wqy-microhei.ttc\\" 18 \\n");\n  //fprintf(pipe,"set yrange [68:70]\\n");\n  fprintf(pipe,"set output \\"test.png\\"\\n");\n  fprintf(pipe, "plot \\"osc.dat\\" title \\"位移\\" with lines, \\"osc1.dat\\" title \\"速度\\" with lines\\n");\n  fprintf(pipe,"quit\\n");\n\n  fprintf(pipe,"quit\\n");\n  pclose(pipe);\n}\n \nvoid runge4(double x, double y[], double step){\n \n  double h=step/2.0, /* the midpoint */\n  t1[N], t2[N], t3[N], /* temporary storage arrays */\n  k1[N], k2[N], k3[N],k4[N]; /* for Runge-Kutta */\n  int i;\n \n  for (i=0;i<N;i++){\n \n    t1[i]=y[i]+0.5*(k1[i]=step*f(x,y,i));\n  }\n \n  for (i=0;i<N;i++){\n \n    t2[i]=y[i]+0.5*(k2[i]=step*f(x+h, t1, i));\n  }\n \n  for (i=0;i<N;i++){\n \n    t3[i]=y[i]+ (k3[i]=step*f(x+h, t2, i));\n  }\n \n  for (i=0;i<N;i++){\n \n    k4[i]= step*f(x+step, t3, i);\n  }\n \n  for (i=0;i<N;i++){\n \n    y[i]+=(k1[i]+2*k2[i]+2*k3[i]+k4[i])/6.0;\n  }\n}\n \ndouble f(double x, double y[], int i){\n \n  if (i==0)\n    x=y[1]; /* derivative of first equation */\n  if (i==1)\n    x=-y[0]-0.5*y[1];\n  return x;\n} \n \n \n Lua\xa0 program \n -- 導入 js 模組\njs = require("js")\n-- 取得 window\nwindow = js.global\n-- 猜小於或等於 n 的整數\nbig = 100\n-- 計算猜測次數, 配合 while 至少會猜一次\nnum = 1\n-- 利用 window:prompt 方法回應取得使用者所猜的整數\nguess = window:prompt("請猜一個介於 1 到 "..big.." 的整數")\n-- 利用數學模組的 random 函數以亂數產生答案\nanswer = math.random(big)\noutput = ""\n-- 若沒猜對, 一直猜到對為止\nwhile answer ~= tonumber(guess) do\n    if answer > tonumber(guess) then\n        output = "猜第 "..num.." 次, guess="..guess..", answer="..answer.." - too small"\n        print(output)\n    else\n        output = "猜第 "..num.." 次, guess="..guess..", answer="..answer.." - too big"\n        print(output)\n    end \n    guess = window:prompt(output..", 請猜一個介於 1 到 "..big.." 的整數")\n    num = num + 1\nend\nprint("總共猜了 "..num.." 次, answer=guess="..answer.." - correct")\n     \n \n \n Javascript\xa0 program \n STLViewer = function(stlpath, plotarea) {\n\n\tvar mycanvas = document.getElementById(plotarea);\n\tvar viewer = new JSC3D.Viewer(mycanvas)\n\tvar theScene = new JSC3D.Scene;\n\t////Initialize with a default file:\n\t//var stlpath = "../../../assets/2013-10-23/stl/box.STL"\n\t//var stlpath = "../../../assets/2013-10-23/stl/taj.stl"\n\tviewer.setParameter(\'SceneUrl\', stlpath);\n    viewer.setParameter(\'InitRotationX\', 20);\n\tviewer.setParameter(\'InitRotationY\', 20);\n\tviewer.setParameter(\'InitRotationZ\', 0);\n\tviewer.setParameter(\'ModelColor\', \'#CAA618\');\n\tviewer.setParameter(\'BackgroundColor1\', \'#FFFFFF\');\n\tviewer.setParameter(\'BackgroundColor2\', \'#383840\');\n\tviewer.init();\n\tviewer.update();\n\t////init done\n\tvar canvas_drop = document.getElementById(\'canvas-drop\')\n\t/*var dropzone = document.getElementById(\'dropzone\')\n\tdropzone.addEventListener(\'dragover\', handleDragOver, false);\n\tdropzone.addEventListener(\'drop\', handleFileSelect, false); */\n\tcanvas_drop.addEventListener(\'dragover\', handleDragOver, false);\n\tcanvas_drop.addEventListener(\'drop\', handleFileSelect, false);\n\n////Drag and drop logic:\n\tfunction handleFileSelect(evt) {\n\t    evt.stopPropagation();\n\t    evt.preventDefault();\n\t    var files = evt.dataTransfer.files;\n\t    console.log(evt)\n\t    console.log(files)\n\t    preview_stl(files[0])\n\t  }\n\n\t  function handleDragOver(evt) {\n\t    evt.stopPropagation();\n\t    evt.preventDefault();\n\t    evt.dataTransfer.dropEffect = \'copy\';\n\t  }\n\n////jsc3d logic\n\tvar handle_file_select = function(e) {\n\t\te.stopPropagation()\n\t\te.preventDefault()\n\t\tvar f = e.target.files[0]\n\t\tpreview_stl(f)\n\t}\n\n\tfunction preview_stl(f) {\n\t\tvar reader = new FileReader()\n\t\tvar ext = f.name.split(".")[1]\n\n\t\tfunction setup_viewer() {\n\t\t\tviewer.setParameter(\'InitRotationX\', 20);\n\t\t\tviewer.setParameter(\'InitRotationY\', 20);\n\t\t\tviewer.setParameter(\'InitRotationZ\', 0);\n\t\t\tviewer.setParameter(\'ModelColor\', \'#CAA618\');\n\t\t\tviewer.setParameter(\'BackgroundColor1\', \'#FFFFFF\');\n\t\t\tviewer.setParameter(\'BackgroundColor2\', \'#383840\');\n\t\t\tviewer.setParameter(\'RenderMode\', "flat");\n\t\t}\n\t\tsetup_viewer()\n\n\t\treader.onload = (function(file) {\n\t\t\treturn function(e) {\n\t\t\t\ttheScene = new JSC3D.Scene\n\t\t    \tstl_loader = new JSC3D.StlLoader()\n\t\t    \tstl_loader.parseStl(theScene, e.target.result)\n\t\t      \t//viewer.init()\n\t\t      \tviewer.replaceScene(theScene)\n\t\t      \tviewer.update()\n\t\t      \tconsole.log("file reader onload")\n\t\t\t}\n\t\t})(f)\n\n\t\tif (ext.toLowerCase() != "stl") {\n\t\t\talert("That doesn\'t appear to be an STL file.");\n\t\t} else {\n\t\t\treader.readAsBinaryString(f)\n\t\t}\n\t}\n}\n \n \n \n Html\xa0 program \n <html>\n   <head>\n      <meta http-equiv="content-type" content="text/html;charset=utf-8">\n      <title>CMSimfly</title>\n      <link rel="stylesheet" type="text/css" href="/static/cmsimply.css">\n   </head>\n   <body>\n      <div class=\'container\'>\n      <nav>\n         <ul id=\'css3menu1\' class=\'topmenu\'>\n            <li><a href=\'/get_page/簡介\'>簡介</a>\n            <li><a href=\'/get_page/目錄結構\'>目錄結構</a>\n            <li>\n               <a href=\'/get_page/頁面編輯\'>頁面編輯</a>\n               <ul>\n                  <li>\n                     <a href=\'/get_page/插入程式碼\'>插入程式碼</a>\n                     <ul>\n                        <li><a href=\'/get_page/Java 程式碼\'>Java 程式碼</a>\n                        <li><a href=\'/get_page/Python 程式碼\'>Python 程式碼</a>\n                        <li><a href=\'/get_page/C或C++程式碼\'>C或C++程式碼</a>\n                        <li><a href=\'/get_page/Lua 程式碼\'>Lua 程式碼</a>\n                        <li><a href=\'/get_page/Javascript 程式碼\'>Javascript 程式碼</a>\n                        <li><a href=\'/get_page/Html 原始碼\'>Html 原始碼</a></li>\n                        </li>\n                     </ul>\n               </ul>\n            <li><a href=\'/get_page/網際簡報\'>網際簡報</a>\n            <li><a href=\'/get_page/網誌編輯\'>網誌編輯</a>\n            <li><a href=\'/get_page/已知錯誤\'>已知錯誤</a></li>\n         </ul>\n      </nav>\n      <section>\n         <form method=\'post\' action=\'/ssavePage\'>\n         <textarea class=\'simply-editor\' name=\'page_content\' cols=\'50\' rows=\'15\'><h3>Html 原始碼</h3></textarea>\n         <input type=\'hidden\' name=\'page_order\' value=\'9\'>\n         <input type=\'submit\' value=\'save\'>\n         <input type=button onClick="location.href=\'/get_page/Html 原始碼\'" value=\'viewpage\'>\n         </form>\n      </section>\n   </body>\n</html>\nCOPY TO CLIPBOARD\t \n \n', 'tags': '', 'url': 'Insert program.html'}, {'title': 'Internet newsletter', 'text': 'CMSimfly 中採用  Reveal.js  作為網際簡報, 其中的維護檔案位於 config/reveal.js, 而對應的簡報檔案則位於 reveal 目錄中. \n', 'tags': '', 'url': 'Internet newsletter.html'}, {'title': 'Pelican edit', 'text': 'CMSimfly 採用  Pelican blog  系統, 編輯檔案位於 config/pelican.leo, 對應的 \n \xa0Markdown 原始檔案位於 markdown 目錄中, 而經 Pelican 轉換出的網誌超文件檔案則位於 blog 目錄中. \n 其餘在網誌文章中所需要的 Javascript 或 Brython 程式檔案, 則與 CMSimfly 及 Reveal.js 共用, 位於 static 目錄下. \n 上傳檔案與圖檔的引用則與 CMSimfly 架構相同. \n 第二位搶這裡也是不遺餘力 \n \n 就是這樣編輯的 \n 接下來修改這裡 \n \n', 'tags': '', 'url': 'Pelican edit.html'}, {'title': 'Q&A', 'text': 'Q1 全部頁面會因無法正確解讀而誤刪 \n A1: 在特定情況下, 系統會誤刪 config/content.htm 檔案, 目前在單頁或全部頁面編輯存檔之前, 或將上一版本的 content.htm 存入 content_back.htm, 若 content.htm 內容被程式誤刪, 可以利用備份檔案複製回原始內容後, 再進行後續處理. \n Q2 頁面標題不支援特殊符號 \n A2: 各頁面標題目前不支援特殊符號, 例如: "/", "?" 等, 若已經發生程式無法解讀頁面的情況, 只能從編輯 config/content.htm 下手, 若系統位於遠端, 則後續必須要再設法提供一個額外的編輯 config/content.htm 檔案的網際連結功能. \n Q3 Video 引用不支援內部引用 \n A3: tinymce 中插入 video 的小視窗, 要移除引用的圖像與連結, 因為一般建議不要在內容中存入 .mp4 的影片資料, 而只接受引入影片 URL 連結. \n Q4 git pull 無法完成程序 \n \n A4:\xa0 主要是沒有git config綁定http proxy的狀態下才發生上述的狀況。 \n https://stackoverflow.com/questions/18356502/github-failed-to-connect-to-github-443-windows-failed-to-connect-to-github \n \n Q5 ungit 無法使用 \n A5:\xa0 必須先到y的home進行user config綁定的更改，這樣才能達到用ungit傳送資料的步驟。 \n \n \n \n Q6 無法開近端動態 \n \n A6: 套件模組沒裝完，須利用指令 pip install 將 flask、bs4、lxml 安裝完成才能開啟近端動態。 \n \n \n Q7 近端看心得是沒問題的但連到遠端卻顯示404 \n 近端是OK的 \n \n 遠端是404 \n \n cmd 資料被移除的部分 \n \n \n A7: 全數的html 莫名的被刪掉，也找不到問題，打開SciTE查看程式碼，也找不到任何可疑的問題，pull的時候問題一直衝突，解決方法就是先將全部的html刪除，就正常顯示了。 \n', 'tags': '', 'url': 'Q&A.html'}, {'title': 'V-rep', 'text': '', 'tags': '', 'url': 'V-rep.html'}, {'title': 'Tutorials', 'text': '', 'tags': '', 'url': 'Tutorials.html'}, {'title': 'BubbleRob tutorial', 'text': '\n Add a primitive\xa0 sphere \xa0of\xa0 diameter 0.2 \xa0to the scene with [Menu bar --> Add --> Primitive shape --> Sphere]. \n Rename to it BubbleRob \n Adjust the\xa0 X-size \xa0item to 0.2 \n Enabled\xa0 Body is respondable \xa0and\xa0 Body is dynamic \xa0. \n Enable\xa0 Collidable ,\xa0 Measurable ,\xa0 Renderable \xa0and\xa0 Detectable \xa0in the\xa0object common properties\xa0for that shape. \n \n \n \n And enter 0.02 for\xa0 Along Z . We make sure that the Relative to -item is set to\xa0 World . Then we click\xa0 Translate selection . \n \n \n \n Add a proximity sensor \xa0[Menu bar --> Add --> Proximity sensor --> Cone type] \n Rename to it\xa0 bubbleRob_sensingNose \n \n \n \n On the\xa0 orientation \xa0tab, we enter 90 for\xa0 Around Y \xa0and for\xa0 Around Z , then click\xa0 Rotate selection . \n \n \n \n In the\xa0 position dialog , on the\xa0 position tab, we enter 0.1 for\xa0 X-coord. \xa0and 0.12 for\xa0 Z-coord. \n \n \n \n \xa0Click\xa0 Show volume parameter  adjust items\xa0 Offset \xa0to 0.005,\xa0 Angle \xa0to 30 and\xa0 Range \xa0to 0.15.  \n \n \n \n \xa0C lick\xa0 Show detection parameters \xa0uncheck item\xa0Don\'t allow detections if distance smaller than. \n \n \n \n Add a pure primitive cylinder with dimensions,size(0.08,0.08,0.02). \n Rename it to\xa0 bubbleRob_leftWheel . \n Set the cylinder\'s absolute position to (0.05,0.1,0.04) \n \n \n \n \xa0Set absolute orientation to (-90,0,0). \n \n \n \n Copy and paste the wheel, and set the absolute \xa0 Y \xa0 coordinate of the copy to \xa0 -0.1 . \n Rename it to\xa0 bubbleRob_rightWheel . \n \n \n \n Add \xa0 joints \xa0 (or motors) for the wheels. Click [Menu bar --> Add --> Joint --> Revolute] \n \xa0Rename it to\xa0 bubbleRob_rightMotor . \n On the\xa0 position \xa0tab, click the\xa0 Apply to selection\xa0button \n \n \n \n On the  orientation \xa0tab, click the\xa0 Apply to selection\xa0button \n we do the same to\xa0 bubbleRob_leftMotor . \n \n \n \n Attach the  bubbleRob_sensingNose \xa0to the\xa0BubbleRob \n Attach the left wheel to the left motor ,and attach motor to BubbleRob \n Attach the\xa0right wheel to the right motor\xa0,and attach motor to BubbleRob \n \n \n \n Click S how dynamic parameters  to open the joint dynamics properties dialog. We enable the motor, and check item  Lock motor when target velocity is zero . \n \n \n \n Add a pure primitive sphere with diameter 0.05 and make the sphere  Collidable, Measurable, Renderable and Detectable.  set\xa0absolute position to(-0.07,0,0). \n Add a force sensor object with [Menu bar --> Add --> Force sensor]. \xa0set\xa0absolute position to (-0.07,0,0.05) \n Attach the slider to the force sensor \n \n \n \n bubbleRob set the local respondable mask to 11110000 \n \n \n \n bubbleRob_slider set the local respondable mask to 00001111 \n \n \n \n select the two wheels and the slider, and in the shape dynamics dialog we click three times M=M*2 (for selection). \n \n \n \n Enabled\xa0 Collidable,\xa0Measurable,\xa0Renderable\xa0and\xa0Detectable. \n \n \n \n \xa0Click\xa0 Add new collection \n Select\xa0 bubbleRob\xa0 \xa0and then click\xa0 Add \xa0in the collection dialog. \n \n \n \n Click\xa0 Add new distance object\xa0 in\xa0 \xa0 distance dialog. \n select a distance pair:\xa0[collection] collection - all other measurable objects in the scene.\xa0 \n \n \n \n Add a\xa0 graph object C lick [Menu bar --> Add --> Graph]. \n Rename it to\xa0 bubbleRob_graph . \n Attach the graph to\xa0 bubbleRob,  and set the absolute coordinates to (0,0,0.005). \n uncheck\xa0 Display XYZ-planes . \n Click \xa0 Add new data stream to record \xa0 \n \n select\xa0 Object: absolute x-position \xa0 for the \xa0 Data stream type , and \xa0 graph \xa0 for the \xa0 Object / item to record.\xa0 record the y and z positions. \n select\xa0 Distance: segment length \xa0for the\xa0 Data stream type , and\xa0 bubbleRob_distance \xa0for the\xa0 Object / item to record . \n \n \n \n Set x y z postion uncheck\xa0Visible. \n \n \n \n Click\xa0 Edit 3D curves , \xa0then click\xa0 Add new curve . \xa0 \n \n bubbleRob_x_pos \xa0 for the \xa0 X-value \xa0 item \n bubbleRob_y_pos \xa0 for the \xa0 Y-value\xa0 item \n bubbleRob_z_pos \xa0 for the \xa0 Z-value \xa0 item \n \n check the\xa0 Relative to world \xa0 item and set \xa0 Curve width \xa0 to 4. \n \n \n \n Add a pure primitive cylinder:(0.1, 0.1, 0.2).\xa0 \n Disable\xa0 Body is dynamic . \n Enable\xa0 Collidable , \xa0 Measurable , \xa0 Renderable \xa0 and \xa0 Detectable . \n Copy and paste the cylinder a few times, and move them to positions around\xa0 BubbleRob. \n \n \n \n Select the model base (B ubbleRob ) then check items \xa0 Object is model base \xa0 and \xa0 Object/model can transfer or accept DNA. \n Select the two joints, the proximity sensor and the graph, then enable item\xa0 Igonred by model bounding box \xa0and click\xa0Apply to selection. \n Select the vision sensor, the two wheels, the slider, and the graph, then enable item\xa0 Select base of model instead. \n \n \n \n Add a\xa0vision sensor, click [Menu bar --> Add --> Vision sensor --> Perspective type] \n At the  same  position and orientation as\xa0 BubbleRob\'s \xa0 proximity sensor,then attach the vision sensor to the proximity sensor. \n Set the local position and orientation of the vision sensor to (0,0,0). \n Set the\xa0 Far clipping plane \xa0 item to 1, and the \xa0 Resolution x \xa0 and \xa0 Resolution y \xa0 items to 256 and 256. \n \n \n \n Clicking\xa0 Show filter dialog . We select the filter component \xa0 Edge detection on work image \xa0 and click \xa0 Add filter . We position the newly added filter in second position (one position up, using the \xa0 up \xa0 button). \n Double-click the newly added filter component and adjust its\xa0 Threshold \xa0 item to 0.2. \n \n \n \n Add a floating view \n \n \n \n Right-click [Popup menu --> View --> Associate view with selected vision sensor]. \n \n \n \n Select\xa0 bubbleRob \xa0 and click [Menu bar --> Add --> Associated child script --> Non threaded]. \n \n \n \n copy and paste following code into the\xa0 script editor \n \n function speedChange_callback(ui,id,newVal)\n    speed=minMaxSpeed[1]+(minMaxSpeed[2]-minMaxSpeed[1])*newVal/100\nend\n\nfunction sysCall_init()\n    -- This is executed exactly once, the first time this script is executed\n    bubbleRobBase=sim.getObjectAssociatedWithScript(sim.handle_self) -- this is bubbleRob\'s handle\n    leftMotor=sim.getObjectHandle("bubbleRob_leftMotor") -- Handle of the left motor\n    rightMotor=sim.getObjectHandle("bubbleRob_rightMotor") -- Handle of the right motor\n    noseSensor=sim.getObjectHandle("bubbleRob_sensingNose") -- Handle of the proximity sensor\n    minMaxSpeed={50*math.pi/180,300*math.pi/180} -- Min and max speeds for each motor\n    backUntilTime=-1 -- Tells whether bubbleRob is in forward or backward mode\n    -- Create the custom UI:\n        xml = \'<ui title="\'..sim.getObjectName(bubbleRobBase)..\' speed" closeable="false" resizeable="false" activate="false">\'..[[\n        <hslider minimum="0" maximum="100" onchange="speedChange_callback" id="1"/>\n        <label text="" style="* {margin-left: 300px;}"/>\n        </ui>\n        ]]\n    ui=simUI.create(xml)\n    speed=(minMaxSpeed[1]+minMaxSpeed[2])*0.5\n    simUI.setSliderValue(ui,1,100*(speed-minMaxSpeed[1])/(minMaxSpeed[2]-minMaxSpeed[1]))\nend\n\nfunction sysCall_actuation()\n    result=sim.readProximitySensor(noseSensor) -- Read the proximity sensor\n    -- If we detected something, we set the backward mode:\n    if (result>0) then backUntilTime=sim.getSimulationTime()+4 end \n\n    if (backUntilTime<sim.getSimulationTime()) then\n        -- When in forward mode, we simply move forward at the desired speed\n        sim.setJointTargetVelocity(leftMotor,speed)\n        sim.setJointTargetVelocity(rightMotor,speed)\n    else\n        -- When in backward mode, we simply backup in a curve at reduced speed\n        sim.setJointTargetVelocity(leftMotor,-speed/2)\n        sim.setJointTargetVelocity(rightMotor,-speed/8)\n    end\nend\n\nfunction sysCall_cleanup()\n\tsimUI.destroy(ui)\nend \n \n', 'tags': '', 'url': 'BubbleRob tutorial.html'}, {'title': 'Weekly progress', 'text': '40623201 \n \n \n \n \n Progress \n Internet site \n \n \n Week1 \n 建立 Windows 64 位元可攜程式系統 \n https://mdekmol.github.io/cd2019b-task1-2019cdb_t1_g5/content/week1.html \n \n \n Week2 \n 建立 Windows 64 位元可攜程式系統 \n https://mdekmol.github.io/cd2019b-task1-2019cdb_t1_g5/content/week1.html \n \n \n Week3 \n 使用ungit做檔案推送及版本推還確認 \n https://mdekmol.github.io/cd2019b-task1-2019cdb_t1_g5/content/40623201-3.html \n \n \n Week4 \n 在可攜程式系統中加上 ungit 、利 用 ssh 與 private key 對 Github 倉儲提交推送 \n https://mdekmol.github.io/cd2019b-task1-2019cdb_t1_g5/content/week4.html \n \n \n Week5 \n 安裝cd2019_cdb_w4套件模組、進行bubbleRob V-rep模擬 \n X \n \n \n Week6 \n 進行 bubbleRob\xa0 V-rep 模擬 \n https://mdekmol.github.io/cd2019b-task1-2019cdb_t1_g5/content/40623201-6.html \n \n \n Week7 \n X \n X \n \n \n Week8 \n 整理bubbleRob V-rep模擬步驟 \n \n https://youtu.be/AM7UNfFY34E \n https://youtu.be/yHP_3PMnb9g \n https://youtu.be/CZcQFJVFFqY \n \n \n \n Week9 \n 錄製期中考影片 \n https://youtu.be/J1MVkrpl6RM \n \n \n Week10 \n \n \n \n \n Week11 \n \n \n \n \n \n \n 40623204\xa0 \n \n \n \n \n Progress \n Internet site \n \n \n Week1 \n \n \n \n \n Week2 \n \n \n \n \n Week3 \n \n \n \n \n Week4 \n \n \n \n \n Week5 \n \n \n \n \n Week6 \n \n \n \n \n Week7 \n \n \n \n \n Week8 \n \n \n \n \n Week9 \n \n \n \n \n Week10 \n \n \n \n \n Week11 \n \n \n \n \n \n \n 40623217 \n \n \n \n \n Progress \n Internet site \n \n \n Week1 \n \n \n \n \n Week2 \n \n \n \n \n Week3 \n \n \n \n \n Week4 \n \n \n \n \n Week5 \n \n \n \n \n Week6 \n \n \n \n \n Week7 \n \n \n \n \n Week8 \n \n \n \n \n Week9 \n \n \n \n \n Week10 \n \n \n \n \n Week11 \n \n \n \n \n \n \n 40623223 \n \n \n \n \n Progress \n Internet site \n \n \n Week1 \n \n \n \n \n Week2 \n \n \n \n \n Week3 \n \n \n \n \n Week4 \n \n \n \n \n Week5 \n \n \n \n \n Week6 \n \n \n \n \n Week7 \n \n \n \n \n Week8 \n \n \n \n \n Week9 \n \n \n \n \n Week10 \n \n \n \n \n Week11 \n \n \n \n \n \n \n 40623229 \n \n \n \n \n Progress \n Internet site \n \n \n Week1 \n \n \n \n \n Week2 \n \n \n \n \n Week3 \n \n \n \n \n Week4 \n \n \n \n \n Week5 \n \n \n \n \n Week6 \n \n \n \n \n Week7 \n \n \n \n \n Week8 \n \n \n \n \n Week9 \n \n \n \n \n Week10 \n \n \n \n \n Week11 \n \n \n \n \n \n \n 40623232 \n \n \n \n \n Progress \n Internet site \n \n \n Week1 \n \n \n \n \n Week2 \n \n \n \n \n Week3 \n \n \n \n \n Week4 \n \n \n \n \n Week5 \n \n \n \n \n Week6 \n \n \n \n \n Week7 \n \n \n \n \n Week8 \n \n \n \n \n Week9 \n \n \n \n \n Week10 \n \n \n \n \n Week11 \n \n \n \n \n \n \n 40623242\xa0 \n \n \n \n \n Progress \n Internet site \n \n \n Week1 \n \n \n \n \n Week2 \n \n \n \n \n Week3 \n \n \n \n \n Week4 \n \n \n \n \n Week5 \n \n \n \n \n Week6 \n \n \n \n \n Week7 \n \n \n \n \n Week8 \n \n \n \n \n Week9 \n \n \n \n \n Week10 \n \n \n \n \n Week11 \n \n \n \n \n \n \n 40623243 \n \n \n \n \n Progress \n Internet site \n \n \n Week1 \n \n \n \n \n Week2 \n \n \n \n \n Week3 \n \n \n \n \n Week4 \n \n \n \n \n Week5 \n \n \n \n \n Week6 \n \n \n \n \n Week7 \n \n \n \n \n Week8 \n \n \n \n \n Week9 \n \n \n \n \n Week10 \n \n \n \n \n Week11 \n \n \n \n \n \n \n 40623244 \n \n \n \n \n Progress \n Internet site \n \n \n Week1 \n \n \n \n \n Week2 \n \n \n \n \n Week3 \n \n \n \n \n Week4 \n \n \n \n \n Week5 \n \n \n \n \n Week6 \n \n \n \n \n Week7 \n \n \n \n \n Week8 \n \n \n \n \n Week9 \n \n \n \n \n Week10 \n \n \n \n \n Week11 \n \n \n \n \n \n \n 40623248 \n \n \n \n \n Progress \n Internet site \n \n \n Week1 \n 建立 Windows 64 位元可攜程式系統 \n \n \n \n Week2 \n 建立 Windows 64 位元可攜程式系統 \n \n \n \n Week3 \n 用ungit做推送及版本確認 \n \n \n \n Week4 \n 建立網站 \n https://github.com/mdekmol/cd2019b-task1-2019cdb_t1_g5 \n \n \n Week5 \n 進行V-rep BubbleRob 模擬，製作模擬過程 \n https://mdekmol.github.io/cd2019b-task1-2019cdb_t1_g5/content/BubbleRob \n \n \n Week6 \n 製作模擬V-rep BubbleRob過程 \n https://mdekmol.github.io/cd2019b-task1-2019cdb_t1_g5/content/BubbleRob \n \n \n Week7 \n X \n X \n \n \n Week8 \n 錄製 V-rep BubbleRob製作影片 \n https://www.youtube.com/watch?v=GWJmfttGDQc \n \n \n Week9 \n 錄製期中考影片 \n https://www.youtube.com/watch?v=_FaJdrCIBo4 \n \n \n Week10 \n 模擬foosball \n https://www.youtube.com/watch?v=QDmz3Z4HX9k \n \n \n Week11 \n \n \n \n \n \n \n 40423220\xa0 \n \n \n \n \n Progress \n Internet site \n \n \n Week1 \n \n \n \n \n Week2 \n \n \n \n \n Week3 \n \n \n \n \n Week4 \n \n \n \n \n Week5 \n \n \n \n \n Week6 \n \n \n \n \n Week7 \n \n \n \n \n Week8 \n \n \n \n \n Week9 \n \n \n \n \n Week10 \n \n \n \n \n Week11 \n \n \n \n \n \n \n', 'tags': '', 'url': 'Weekly progress.html'}, {'title': 'Experience', 'text': '20190222 week1 \n 20190301 week2 \n 20190308 week3 \n 20190315 week4 \n 20190322 week5 \n 20190329 week6 \n 20190329 week7 \n 20190329 week8 \n 20190329 week9 \n', 'tags': '', 'url': 'Experience.html'}, {'title': '20190222 week1', 'text': '40623201-1 \n 40623204-1 \n 40623217-1 \n 40623223-1 \n 40623229-1 \n 40623232-1 \n 40623242-1 \n 40623243-1 \n 40623244-1 \n 40623248-1 \n 40423220-1 \n', 'tags': '', 'url': '20190222 week1.html'}, {'title': '40623201-1', 'text': '這周是這學期第一次上課，為了補228連假的課而一次上8節課，真的有點吃不消，這周學習到怎麼建立個人可攜倉儲，以前只是用老師幫我們建立好的，所以不知道建立可攜倉儲的步驟那麼的繁瑣，要先下載 \xa0 Python 3.7.2、\xa0 HxD (二位元編輯器) \xa0、\xa0 SciTE (編譯器) \xa0、 KDiff( 用來比較差異性的 ) \xa0、 \xa0 TCC (C 編譯器 ) 等工具，還要更改start.bat 及 stop.bat，最後才能夠完成建立可攜倉儲，過程中在更改pip路徑時，不小心動到二位元資料，而導致路徑錯誤，最後複製其他還沒更改的，重新更改過就成功了。 \n 我將操作步驟整理在 Course content 內的  week1 。 \n', 'tags': '', 'url': '40623201-1.html'}, {'title': '40623204-1', 'text': '這學期第一週，上課學系建立可攜式倉儲，之前都是老師建立好讓大家下載，今天自己親自做一次，才知道有很多繁瑣的步驟，也會遇到很多問題。收先要先下在 python3.7.2 、 hxd 、 scite、 kdiff 、 tcc ，並利用舊的可攜式倉儲的 start.bat 和 stop.bat\xa0 更改內容，這樣才能建立一個可攜式倉儲，國城中我遇到很多問，但都有一一解決，也從中學到很多之前不會的東西。 \n \n', 'tags': '', 'url': '40623204-1.html'}, {'title': '40623217-1', 'text': '心得: \n 這星期為了配合228連假的補課，所以從下午1:20一連貫的上到晚上9:50，雖然這途中有休息，但還是覺得非常的累，這周要做出一個自製的可攜Python系統，這東西除了要到官方的 python3.7.2 下載外，還得載下 SciTe editor 的編譯器，為的是能夠在裡面寫下開啟python系統的編譯程式碼，除此之外要再下載一個 hxd 二維編譯碼，為了要讓執行時可在自己要求的home裡頭執行，最後最重要的是必須了解之前python系統的start、stop批次檔的內容寫的是什麼，光是最後一個就是很煩躁的東西，因為只要弄錯，可能就無法開啟，或是開完後無法關閉，這天光是處理這個就很燒腦了，且還得用global檢查code是否是自己要的，做完後的我只感覺到稍微放鬆，畢竟一件東西最可怕的不是它有多難，而是如何去摸索並得知裏頭的涵義，就算了解了也不會覺得開心，而是一種奇怪的滿足感罷了。 \n 簡易製作過程如下: \n 1.下載python3.7.2。 \n \n \n \n \n 2.下載HxD二維編輯器。 \n \n \n \n 3.修改home的位置，查到p37進行修改。 \n \n 4.修改為y:\\p37\\python.exe 。 \n \n 5.下載SciTe編輯器。 \n \n 6.到選項的Global options file裡更改。 \n \n 7.用快捷ctrl+f ，打上code.page。 \n \n 8.將65001的部分設定為開啟，將code.page=0的前方打上#即可關閉。 \n \n 9.將突下反白的部分新增上去即可，完成我們所需要的start.bat的批次檔。 \n \n 10.圖下為stop.bat的批次檔。 \n \n \n', 'tags': '', 'url': '40623217-1.html'}, {'title': '40623223-1', 'text': '才剛開學第一周就要連上8堂課，不管是在肉體還是精神都受到折磨，但是為了放假這都是必要的過程，想到這裡原本已經快要消失的意識又被拉了回來，說起來建個隨身系統真是麻煩，弄到一半心思都飄到下禮拜去了，先是下載下來然後改裡面的目錄，然後再砍掉.....重複，還有一些執行檔的程式設定，看到一半就放棄理解直接去複製以前的來改，我只能說，從頭開始真是不容易......最後還是直接下載老師上傳的檔案。 \n 補充一下，雖然有直接抓用好的檔案，但隨身系統什麼的我還是有做完的拉，有沒有作對就不知道就是了 \n', 'tags': '', 'url': '40623223-1.html'}, {'title': '40623229-1', 'text': '第一週直接八節課，從原本的下午一路上到傍晚再從傍晚上到晚上，原本老師還問大家要不要在上第三個禮拜的課，可以再多放一個禮拜，當然是要阿，只可惜最後只上道了10點，主要學習如何自己動手做start以及stop然後了解是如何啟動的，這些東西如果只是看過的話日後一定沒有印象，但是如果自己動手試試看的話會在更了解一點 \n', 'tags': '', 'url': '40623229-1.html'}, {'title': '40623232-1', 'text': '這學期第一週，上課學系建立可攜式倉儲，之前都是老師建立好讓大家下載，今天自己親自做一次，才知道有很多繁瑣的步驟，也會遇到很多問題。首先要先下在 python3.7.2 、 hxd 、 scite、 kdiff 、 tcc ，並利用舊的可攜式倉儲的 start.bat 和 stop.bat\xa0 更改內容，這樣才能建立一個可攜式倉儲，過程中我遇到很多問題，但都有一一的解決，也從中學到很多之前不會的東西，一門學問不能不求甚解，不懂就問，但也不要一開始就問，試著思考問題，才是可以嚷自己成長的推手。 \n', 'tags': '', 'url': '40623232-1.html'}, {'title': '40623242-1', 'text': '這週是這學期第一次上課，為了補228連假的課一次上好上滿8節課，真的有點硬，這周學習到怎麼建立個人可攜倉儲，以前只是用老師幫我們建立好的，所以不知道建立，這次由我自己開始從零到可執行，原來可攜倉儲的步驟那麼的繁瑣，要先下載 \xa0 Python 3.7.2、\xa0 HxD (二位元編輯器)\xa0、\xa0 SciTE (編譯器)\xa0、 KDiff( 用來比較差異性的 ) \xa0、 \xa0 TCC (C 編譯器)等工具，還要更改start.bat 、start_cadlab.bat及 stop.bat，最後才能夠完成建立可攜倉儲，過程中遇到的問題一為在更改pip路徑時，不小心動到二位元資料，而導致路徑錯誤，最後複製其他還沒更改的，重新更改過就成功了，問題二為一直無法認證資料，原本的資料認證位老師的，沒把資料改為自己的，所以怎樣打自己的帳密都無法順利認證登入。 \n 我和組長遇到的問題整理在Q&A還有操作步驟整理在 Course content 內的 \xa0 week1 \n', 'tags': '', 'url': '40623242-1.html'}, {'title': '40623243-1', 'text': '第一周上課，因為遇到連假要補課，一次從中午開始上課到晚上共八節課，講了許多關於協同及模擬相關內容，及本學期主要目標 。還有以前都不用動手做但是這次自己改的start.bat，首先要先上網站下載許多個別的東西，然後經由scite去做更改，中途也是遇到許多問題，也是經由同學幫忙才得以解決。 \n', 'tags': '', 'url': '40623243-1.html'}, {'title': '40623244-1', 'text': '剛開學，而且下週放一次假，又不想在找時間補課，於是乎我一連上了八堂課，中間休了一小時去吃飯，雖然累，不過這八堂課，只有前幾節老師帶著我們操作如何建立自己的可攜系統，之後的時間讓我們自己看著老師的影片操作，建立自己的可攜系統雖然方便，但系統內的軟體時常改版更新，過了一段時間，需要在自己調整自己的可攜系統。 \n', 'tags': '', 'url': '40623244-1.html'}, {'title': '40623248-1', 'text': '', 'tags': '', 'url': '40623248-1.html'}, {'title': '40423220-1', 'text': '這周是這學期第一個禮拜上課，老師突然說因228連假補課而連上8節課，我的心好累! 這周的學習目標是如何建立可攜程式系統，因為是重修生，好久沒有接觸到python的課程，看到那些步驟頭很大。 要先下載 Python3.7.2、 HxD(二位元編輯器) 、 SciTE(編譯器) 、KDiff(用來比較差異性的) 、 TCC(C編譯器)等工具，還要更改start.bat 及 stop.bat，最後才能夠完成建立可攜倉儲。 好在經過請教同學之後，問題都有一一解決。 \n', 'tags': '', 'url': '40423220-1.html'}, {'title': '20190301 week2', 'text': '放假搂～２２８ \n \n', 'tags': '', 'url': '20190301 week2.html'}, {'title': '20190308 week3', 'text': '40623201-3 \n 40623204-3 \n 40623217-3 \n 40623223-3 \n 40623229-3 \n 40623232-3 \n 40623242-3 \n 40623243-3 \n 40623244-3 \n 40623248-3 \n 40423220-3 \n \n', 'tags': '', 'url': '20190308 week3.html'}, {'title': '40623201-3', 'text': '這周在教如何使用ungit做檔案推送及版本推還確認，中間在試的過程中發現按commit後會發生錯誤，後來才發現原來是home底下的身分綁定沒有更改導致錯誤，更改後就順利完成了。ungit之所以方便的地方在能夠打中文以及清楚的樹狀圖顯示推了什麼，對於英文不好的來說是一大方便之處，也能更清楚的詮釋更改或新增的東西，十分方便。 \n \n \n', 'tags': '', 'url': '40623201-3.html'}, {'title': '40623204-3', 'text': '上課心得&內容 : 這週上課教如何在可攜程式系統中配置 ungit、使用ungit推送及版本推還確認，過程中發生按commit後會發生錯誤，之後發現原來是home底下身分綁定沒有更改導致錯誤，更改後就順利完成了。ungit之所以方便是因為在能夠打中文、擁有清楚的樹狀圖顯示新增了哪些東西，還能確定之前的版本是否可以取得，也能夠在必須時回到初始狀態編輯，更能清楚的詮釋更改或新增的東西，對於英文不太優秀的我來說是非常方便的。 \n', 'tags': '', 'url': '40623204-3.html'}, {'title': '40623217-3', 'text': '\n 上課內容: \n 手做簡報: https://mdekmol.github.io/cd2019b-task1-2019cdb_t1_g5/content/week3.html \n 心得: \n 經過這星期的ungit教學，讓我發現到這東西的存在可以很簡單的進行傳送資料到倉儲外，還能讓自己去確定之前的版本是否可以取得，能夠在需要的時候回到當初的事物狀況加以編輯，且可以透過這樣的方式，知道曾經做過哪些歷程，能過一目瞭然 ，算是目前讓我覺得非常方便的操作 。 \n', 'tags': '', 'url': '40623217-3.html'}, {'title': '40623223-3', 'text': '老師上課的時候交了一個新的名叫ungit推送程式，剛看到的時候覺得好像不錯用，介面也沒有像cmd那麼有壓迫感，感覺應該之後會改用這個，然而在使用之前要設定一大堆有的沒的，除了啟動檔外還要用什麼ssh的認證設定，那個我用的頭很痛，我想我可能不適合用ungit吧 \n', 'tags': '', 'url': '40623223-3.html'}, {'title': '40623229-3', 'text': '這週主要老師都在幫我們複習如何使用git然後藉由ungit來推送，並且還有綁定config雖然這個部份是我們第一次的接觸難免會有一些生疏，但是經過一節課以後再配上老師上傳的影片會發現沒有想像中的複雜。 \n', 'tags': '', 'url': '40623229-3.html'}, {'title': '40623232-3', 'text': 'ungit 進行檔案推送及版本的推還確認，綁定 config，到python wsgi.py動態網站更改部分的資料 ，接著開啟ungit後進行commit上傳，到warehousing尋找commit recond，介紹如何使用ungit。 \n', 'tags': '', 'url': '40623232-3.html'}, {'title': '40623242-3', 'text': '這週教了一個新的東西叫ungit，原來這東西就是我們之前所有的推送過程的圖解版，不只讓我發現到這東西的存在可以很簡單的進行傳送資料到倉儲外，還能讓自己去確定之前的版本是否有任何小東西被合併可以透過樹狀圖來得知，能夠在需要的時候回到當初的事物狀況加以編輯，且可以透過這樣的方式，就不一定要開到Github.com的commit查看知道曾經做過哪些歷程，能過一目瞭然 ，讓我覺得非常乾淨方便的系統 。 \n', 'tags': '', 'url': '40623242-3.html'}, {'title': '40623243-3', 'text': '第三週，這週持續著更改程序，老師要我們使用ungit去整理 ，是很方便但很陌生，對於我們剛開始看到，還是有點摸不著頭緒，雖然大致上的使用機制是差不多的，都是近端再推到遠端，雖然陌生但不會太難，就是需要一點時間摸索及使用 \n', 'tags': '', 'url': '40623243-3.html'}, {'title': '40623244-3', 'text': '這週老師教我們如何用ungit去整理倉儲，雖然很方便，但第一次看到操作步驟，還是會很混亂，因為跟原本學的推送不一樣，但是原理是一樣的，而且介面比較方便去管理，不像以前學的，要檢查有沒問題，會一直檢查不出來，雖然ungit簡單了許多，仍需要一段時間適應。 \n', 'tags': '', 'url': '40623244-3.html'}, {'title': '40623248-3', 'text': '', 'tags': '', 'url': '40623248-3.html'}, {'title': '40423220-3', 'text': '這週是第三週,這週的上課內容是有關ungit的認識與配置,首先,這東西可以很簡單的進行傳 送資料到倉儲外,還有明確的版次,並且可以取得過去版本進行修改,非常之方便。 \n https://www.youtube.com/watch?v=Za2ChGZlatc \n', 'tags': '', 'url': '40423220-3.html'}, {'title': '20190315 week4', 'text': '40623201-4 \n 40623204-4 \n 40623217-4 \n 40623223-4 \n 40623229-4 \n 40623232-4 \n 40623242-4 \n 40623243-4 \n 40623244-4 \n 40623248-4 \n 40423220-4 \n \n', 'tags': '', 'url': '20190315 week4.html'}, {'title': '40623201-4', 'text': '這周在上可攜程式系統中加上 ungit 和利用 ssh 與 private key 對 Github 倉儲提交推送，設定 private key 可以節省打帳號密碼的時間，雖然方便但是如果隨身碟弄丟，就要馬上將 private key 弄掉，否則撿到的人也有辦法隨意更改你的東西，還是有一些風險在。這週也開始分組的進行討論了，希望組員們都能做事，不要只想躺分，自己要對自己的學分負責，不想做事就要有被打低分的覺悟。 \n 我將操作步驟整理在 Course content 內的\xa0 week4 。 \n \n', 'tags': '', 'url': '40623201-4.html'}, {'title': '40623204-4', 'text': '上課內容 : 這週開始進行分組製作實習事務2的手足球。上課內容是如何利用 ssh 與 private key 對 Github 倉儲提交推送設定 private key 可以節省輸入帳號密碼的時間，雖然方便但是如果隨身碟不見，必須將 private key 刪掉，否則撿到的人可以隨意更改原有東西。 \n', 'tags': '', 'url': '40623204-4.html'}, {'title': '40623217-4', 'text': '這周開始分組進行討論，從這周開始到學期中必須要做出立體模擬手控足球台，在我看來，除了繪圖、vrep、網站維護、報告、翻譯電子書摘要，目前我只能想到這些能執行的任務，可是以一個組來說，真正的做到的是每個人都必須找到自己能做到的，因為這不只是分數這麼簡單，更主要的是必須明白自己是否有學習並得知當前該有的以及自身不足的，不管人到那裡總能遇到比自己強的人，可以我的觀點這是給自己的警惕，假設自己不求目標的努力或是漫無目的，那只是行屍走肉。 \n', 'tags': '', 'url': '40623217-4.html'}, {'title': '40623223-4', 'text': 'ungit除了介面比較好看之外好像沒什麼較為突出的優點耶,用了之後發現不習慣之外還很lag,放著一段時間後還會跳掉重讀,看來還是用以前的推送方式較為實在 \n 還有分組後現在還沒有明確的工作,不知道現在要幹嘛,其他人好像都很忙沒空理我,該怎麼說呢,就是有點坐不住的焦躁感 \n', 'tags': '', 'url': '40623223-4.html'}, {'title': '40623229-4', 'text': '這週分組完組員們開始討論，然後老師給我們一個方向，必須去弄出立體手控足球台，一個立體的足球台需要的是很多的步驟，以及一步一步地進行，因此要在每一個禮拜完成一些進度才有能做的完。 \n', 'tags': '', 'url': '40623229-4.html'}, {'title': '40623232-4', 'text': '開始分組 ~ ，分好組討論，並分配任務執行，還有互評機制，防止不做事的人偷懶躺分 \n', 'tags': '', 'url': '40623232-4.html'}, {'title': '40623242-4', 'text': '這週開始分組進行討論，從現在開始到學期中必須要做出立體模擬手控足球台，在看完老師的解釋，不只單純的繪圖、網站維護、報告、翻譯電子書摘要，最重要的是V-rep想到這些執行的任務就覺得頭痛，可是以一個組來說，每個人都必須了解自己能做的有甚麼，更重要的是每個人都必須長是新的東西，因為這不只是分數這麼簡單，更主要的是必須明白自己是否有學習到該學的東西，並了解當前自身不足的地方，不管人到那裡總能遇到有其他領域比我強的人，但我也不是省油的燈，這是給自己繼續學習的動力，假設自己不求目標或是漫無目的過一天是一天，那只是無意義的過。 \n', 'tags': '', 'url': '40623242-4.html'}, {'title': '40623243-4', 'text': '這週開始分組討論 ，必須分組完成手足球的模擬，從畫圖，維護網誌，還有最困難的V-rep模擬，就是將以前自己玩別人完成的，現在要自己用程式做出來，就沒那麼容易了，包括各種小細節，得分，碰撞力道，方向等等，這週還有補充一些上一週的ungit的內容，以及解決一些修改上的問題 \n', 'tags': '', 'url': '40623243-4.html'}, {'title': '40623244-4', 'text': '這週老師講解一下分組所要做的任務是什麼，其為手足球系統，簡而言之，就是將實體在玩的遊戲，變成可遊玩的程式遊戲，雖然看起來很好玩，但是要做成可以玩的遊戲，就不容易了，講解任務後，又補充上週kungit的一些東西，也幫有問題的同學想辦法解決。 \n', 'tags': '', 'url': '40623244-4.html'}, {'title': '40623248-4', 'text': '', 'tags': '', 'url': '40623248-4.html'}, {'title': '40423220-4', 'text': '這週老師公布了任務是建立一個模擬手足球台,但是這非常複雜需要小組分工才能順利完成,並且還教了如何使用ssh與private key的配置進行對github提交推送。 \n \n \n \n \n', 'tags': '', 'url': '40423220-4.html'}, {'title': '20190322 week5', 'text': '40623201-5 \n 40623204-5 \n 40623217-5 \n 40623223-5 \n 40623229-5 \n 40623232-5 \n 40623242-5 \n 40623243-5 \n 40623244-5 \n 40623248-5 \n 40423220-5 \n \n', 'tags': '', 'url': '20190322 week5.html'}, {'title': '40623201-5', 'text': '這週在課堂之前就有發現上週用的cd2019_cdb_w4有些套件模組沒裝完，導致在開近端時會發生問題， 須利用指令 pip install 將 flask、bs4、lxml 安裝完成就能開啟近端動態。 這週也開始接觸到 bubbleRob 的\xa0 V-rep 模擬，看到老師給的文章全部是英文真的很頭暈，希望能好好把它看懂也能順利做完。 \n', 'tags': '', 'url': '40623201-5.html'}, {'title': '40623204-5', 'text': '繪製實驗任務二的圖 \n \n 球員 \n \n 桿子 \n \n 球場 \n \n 組合 \n 心得:這週我們這組分配工作，我負責畫圖，這週我第一次嘗試用 Onshape 做組合圖，中間有很多都是其他組員跟我說要怎麼做的，所依我學到很多之前不知道的指令。上課前我還沒 clone 我們這組的倉儲，其他組員發現我有東西沒有下在，所以告訴我要怎麼用，要下載甚麼，也知道了可攜式倉儲有很多東西是我不知道的，要多多上網找資料跟好好學習。 \n', 'tags': '', 'url': '40623204-5.html'}, {'title': '40623217-5', 'text': '這星期我開始碰vrep的軟體，使用起來相當的難，這也許是我沒碰過，所以覺得很難，但萬事起頭難這句話也不是錯的，月是沒接觸過的東西，代表這有著自己某方面的必要知識，所以我仍然會去摸索各別各樣的事物，最重要的是別讓自己太過懶散，導致時間的浪費，就算只是件小事也必然有它的意義，vrep雖然現在對我很難，但只要我花時間看好英文，了解內部的資訊，我想應該能有一點點小成就也說不定。 \n \n', 'tags': '', 'url': '40623217-5.html'}, {'title': '40623223-5', 'text': '這週大家的工作基本上都分配玩了,所以說我的那個工作呢?是不是變成沒用的後備人員阿 \n 除了分配完工作外還有叫我麼練習v-rep的模擬,不過這個說明手冊是全英文的ㄟ,這是要怎麼用拉,我用了一整節課連一個軸都搞不定,恩,英文真的是很重要呢 \n', 'tags': '', 'url': '40623223-5.html'}, {'title': '40623229-5', 'text': '這週當我要推東西上去網頁的時候發現無法推送也無法git pull，後來也找不到辦法，因此我將資料夾全部刪除後重新去clone，才顯示正常也能正常推送，有些時候找不到解決方法的時候刪掉重來也是一種好方法。 \n', 'tags': '', 'url': '40623229-5.html'}, {'title': '40623232-5', 'text': '\n 本週因電腦故障送修，但還是觀看上課影片、教材，了解到手足球模擬需要分析哪些地方及模擬，在軟體上模擬的好處是，在花一堆錢組出硬體設備之前先免去許多複雜的情況並排除，減少一些可以先行避免的情況。 \n \n 分組討論，自評，做了什麼附上佐證，很棒的機制 \n', 'tags': '', 'url': '40623232-5.html'}, {'title': '40623242-5', 'text': '這週我們這組分配工作，我和組長負責網頁管理，才剛開始這週我才第一次嘗試用自己用的可攜程式來重新整理網站，直接爆炸，一直跑出404，看了看找不出原因，但用之前的版本來更新，卻又OK，我從頭開始檢查我的可攜程式，發現到start.bat中有一行直接省略加上少一個點，改完之後就OK了，用程式就是必需要專注一點，若少了一點東西，就會導致程式整個大崩壞，每次都要重頭還真的有點頭疼。 \n', 'tags': '', 'url': '40623242-5.html'}, {'title': '40623243-5', 'text': '這週上課都在模擬BubbleRob ，在V-rep從設置外觀，增加感測器及鏡頭，還有動力模擬等等，照著教學原文文章去做，但時間不足，沒能做到重點模擬部分，也是跟著文章做，同時也去熟悉V-rep的功能及模擬相關，以及多看原文的文章，多熟悉英文及V-rep \n', 'tags': '', 'url': '40623243-5.html'}, {'title': '40623244-5', 'text': '整堂課都在研究bubbleRob tutorial，從第一步在V-rep增加物件，在物件上加上感測器，配置傳動軸，使其物體能運動，由時間不足，在最重要的地方尚未著手進行，不過在過程中，慢慢習慣看原文的文章，漸漸地熟悉V-rep，去做出一個bubbleRob。 \n', 'tags': '', 'url': '40623244-5.html'}, {'title': '40623248-5', 'text': '這禮拜開始做vrep tutorial的第一個教學，之前雖然有碰過，可是做過簡單的事情，做起來還是有點困難，加上都是英文，從頭做到完要花不少時間來研究，這次沒有做完了，可是卻沒有如預期地作動，哪個地方漏掉了吧。 \n \n', 'tags': '', 'url': '40623248-5.html'}, {'title': '40423220-5', 'text': '這禮拜分組開始進行分工合作,練習了一下v-rep,要看的懂v-rep tutorial很有難度,只能慢慢的拆單字看,不懂的google,大概勉強懂了50%。 \n \n \n', 'tags': '', 'url': '40423220-5.html'}, {'title': '20190329 week6', 'text': '40623201-6 \n 40623204-6 \n 40623217-6 \n 40623223-6 \n 40623229-6 \n 40623232-6 \n 40623242-6 \n 40623243-6 \n 40623244-6 \n 40623248-6 \n 40423220-6 \n \n', 'tags': '', 'url': '20190329 week6.html'}, {'title': '40623201-6', 'text': '這周在進行 bubbleRob 的 V-rep 模擬，一開始對軟體不熟悉，加上又都是英文的，在操作上有許多的問題，但多試幾次後有比較好一點，在英文閱讀上也增加了許多耐心，遇到不會的單字以及操作上的問題，也能慢慢去克服了。過程中容易有步驟做錯就發生問題，要很詳細的去檢查是否哪裡出問題，真的要花費一些時間。 \n \n', 'tags': '', 'url': '40623201-6.html'}, {'title': '40623204-6', 'text': '心得:這週因為該畫的圖都畫完了，所依我跟著大家練習模擬 v-rep ，上學期並沒有實際操作過，所以並不會打開，也是其他組員教我我才會的，後來看著老師給的資料慢慢做，但因為是英文，所以花了不少時間翻譯單字，下週會多花一些時間慢慢跟上大家的腳步，成功模擬出來。 \n', 'tags': '', 'url': '40623204-6.html'}, {'title': '40623217-6', 'text': '這星期我開始觸碰關於vrep的相關內容，雖目前分工並非確定，可是我基本能碰什麼就盡量學習什麼，在我剛碰沒多久，一看見一堆自己根本沒見過的東西，老實說我其實很膽怯，因為看見這些後，並沒有什麼操作的實際感，或許是全都英文的關西，但是再困難的東西給我，我都得要去認得並摸索，目的只是想著如果自己不學這東西是可以，可是只是以自己的時間和自身的精力來衡量，不去學習實在是不行，現在我只知道這軟體能過透過呼叫系統內部的部件來進行組合做出簡易的構想藍圖，但我覺得當從其他繪圖軟體匯入vrep時，部分的構件也得想辦法做更改或是使物體至少偏差不可過大(前提是必須符合物理定義上的運動)，我也想過是否可以讓手足上的人偶能在前1秒預測球的運動方向，如果可以那肯定很難進龍門也說不定。 \n 步驟連結: http://www.coppeliarobotics.com/helpFiles/en/bubbleRobTutorial.htm \n 手作影片 https://www.youtube.com/watch?v=4M96bKCxg6o&feature=youtu.be \n \n', 'tags': '', 'url': '40623217-6.html'}, {'title': '40623223-6', 'text': '這周依然沒有明確的工作，所以還是在練習V-rep，跟上周比起來進步了很多，原本連軸都搞不懂要怎麼用，現在已經可以讓它前進而不會隨便亂飛；這都是教學手冊的功勞，雖然英文還是有些吃力，但一步一步跟著慢慢來還是做得到的 \n 不過現在卡在如下圖的一個地方，有點搞不懂它的意思 \n \n 這個禮拜的練習結果，已經可以跑了，但感測器和數值圖表還沒設定 \n \n', 'tags': '', 'url': '40623223-6.html'}, {'title': '40623229-6', 'text': '這週開始研究所謂的bubblerob，其實從上週就可以開始執行研究了，因為全部的步驟都是以英文呈現因此要多花一倍的時間去理解，然後操作，我一開始只有把球給叫出來還有學習定位而已，其實慢慢理解以後會發現其實都是英文也不賴不僅可以學習字彙還可以增進閱讀英文的速度。 \n', 'tags': '', 'url': '40623229-6.html'}, {'title': '40623232-6', 'text': '\n 上週就開時再研究v-rap，老師丟給我們資料要我們做出裡面的bubblerob，一打開檔案，怎麼都是英文，我一個傻眼，不過這樣還是沒辦法阻饒我學習的熱忱，就開始研究八，一起找了個同組比較了解的人一起討論，一開始操作上出現很多問題。經過部過的修改討論，終於有點頭緒，在英文閱讀上我學到許多的單字，不懂就去查，查了就把她記熟就是你的，這樣一來一往，真是受益良多壓，若出現問題先不要緊張，發現問題，找到原因，解決問題，若不行記下來，詢問如何解決，真的瞭解這就將會是你的東西，誰也搶不走，偷不走，問題還很多還需要多研究，加油! ! \n \n 第一次做的時候 \n \n \n', 'tags': '', 'url': '40623232-6.html'}, {'title': '40623242-6', 'text': '上週因為網站問題導致我進度落後，上週大家都開始在研究bubbleRob，但這週我才開始準備進行 bobbleRob 的 V-rep 模擬，一開始對軟體不熟悉，加上又都是英文的，在操作上有許多的問題，好加在其他同學們已經有點頭敘了，幫了我許多，多試幾次後有比較好一點，在英文閱讀上也增加了許多能力及單字庫，遇到不會的單字以及操作上的問題，也能慢慢去克服了。過程中容易有步驟做錯就發生問題，要很詳細的去檢查上一步是否哪裡出問題或是哪裡沒設定好，真的要花點耐心和許多 時間，還在研究模擬跑動，問題還很多需要多點時間研究。 \n \n', 'tags': '', 'url': '40623242-6.html'}, {'title': '40623243-6', 'text': '這週進行Bubble Rob的模擬，跟著老師在網站上放的Tutorial在V-rep進行模擬，教學上雖說是全英文，但也不至於到全部都看不懂，還是能跟著做，只是中途也有遇上問題，有時會漏掉步驟，有時則是結果與預期不符，模擬出額外的東西，再倒退回去跟著教學重做，或是無法模擬出來等等問題，這樣改也不算輕鬆也不算難，就只是耐心的問題，遇到問題不用馬上就問同學，有時自己會發現問題也能自己解決 。 \n', 'tags': '', 'url': '40623243-6.html'}, {'title': '40623244-6', 'text': '這週一樣繼續做bubbleRob，雖然上一週的進度比較多，但是這週卻一直卡在程式模擬上，首次模擬時，當物件在移動時，sensor一直沒有反應，最後發現sensor沒有調整好，才會沒有反應，第二次原因在於物件上的視角無法出現在view sensor上，經過和同學的討論，完成了bubbleRob。雖然只是一直照著步驟做，但是自己一個人做，有一些細節會沒有注意到，但是多人一起討論，可以彌補這些細節。 \n BubbleRob \n \n', 'tags': '', 'url': '40623244-6.html'}, {'title': '40623248-6', 'text': '', 'tags': '', 'url': '40623248-6.html'}, {'title': '40423220-6', 'text': '這週在進行 bubbleRob 的 V-rep 模擬,軟體雖然上次有用過,不過那已經是2年前了,基本上全都忘記了,只能照著影片與英文的說明書去查找,真的需要非常大的耐心。 \n 這是我的模擬影片: https://www.youtube.com/watch?v=-Tl7YTdyfT8 \n', 'tags': '', 'url': '40423220-6.html'}, {'title': '20190405 week7', 'text': '\n \n', 'tags': '', 'url': '20190405 week7.html'}, {'title': '20190412 week8', 'text': '40623201-8 \n 40623204-8 \n 40623217-8 \n 40623223-8 \n 40623229-8 \n 40623232-8 \n 40623242-8 \n 40623243-8 \n 40623244-8 \n 40623248-8 \n 40423220-8 \n \n', 'tags': '', 'url': '20190412 week8.html'}, {'title': '40623201-8', 'text': '第六周將 BubbleRob 操作後覺得對 V-rep 還是不熟悉，過程中發生三次錯誤找不出哪裡有錯誤，而重做了三次，因此這周將步驟整理成後錄成影片多熟悉一下。以下是模擬成功的檔案。 \n \n \n \n', 'tags': '', 'url': '40623201-8.html'}, {'title': '40623204-8', 'text': '這週開始模擬 V-rep ，中間我遇到一些問題，都是同組的組員教我的或告訴我在哪裡。又因為是英文，所以我花了四堂課才把實習任務2老師給的東西翻譯完模擬出來。但在模擬的時候會出現一個東西，希望之後可以找到原因。下課後我幫一個同組也不太會的組員模擬，雖然有做出來，但是因為一些東西更改錯誤，所以影響最後模擬出來的結果，最後是請老師幫忙找錯誤，我才知道我主從設定錯誤而影響組員的東西不能正常移動，後來又發現我沒有把名字改對，所以不能跟程式中的名稱應對，才使得我第二次模擬出來的東西一直怪怪的，不能正常移動。 \n \n \n \n', 'tags': '', 'url': '40623204-8.html'}, {'title': '40623217-8', 'text': '這周開始第三個的實習任務，當我看完裡面的tutorial雖然是了解他的目的是希望將物件可透過V-rep內部的CAD可接收的內建中轉入到V-rep，可是事實上他仍有限定的要求，因為當物件假定用stl的檔件丟入到V-rep的內部時進行轉換模擬，V-rep會將此圖檔轉換成好幾千甚至上萬的三角形，主要是方便做CAE方面的分析，可是當超過20000個上限時有可能造成無法啟動甚至是不給予支援也說不定，試著用Onshape畫出一張圖並試著用stl檔件轉入，目前可以弄出大概的雛形，只是tutorial後面似乎還有一些東西得用，剩餘的可能要等下星期再接續著做。 \n 圖片如下: \n \n \n \n \n \n \n tutorial connected:\xa0 \n http://www.coppeliarobotics.com/helpFiles/en/buildingAModelTutorial.htm \n By the way: V-REP支持目前以下CAD數據格式： OBJ ， STL ， DXF ， 3DS （僅限Windows）和 Collada 。 URDF 也受支持， 它不是純粹的基於網格的文件格式。 \n', 'tags': '', 'url': '40623217-8.html'}, {'title': '40623223-8', 'text': '這禮拜明明早就可以把V-REP的練習做完的，可是不知道為什麼在最後一步出現錯誤，搞屁阿，然後去請教同學、上網查、之後還重做了一遍還是跳出錯誤，說什麼感測器參數錯誤?我明明就把程式碼原封不動的複製貼上!是會有什麼問題拉!唉.....下禮拜就是期中考，我看是做不完了 \n 就是下面這個錯誤 \n \n 就會向下面那樣撞車 \n \n 還有就是期末的報告，我好像除了把每周的心得推上去以外好像沒做什麼其他有貢獻的事ㄟ，這是不是有點不太妙阿? \n', 'tags': '', 'url': '40623223-8.html'}, {'title': '40623229-8', 'text': '這週我將實習二的題目給完成了一開始做完發現當我按下執行的時候，球同時會往後仰這就奇怪了，也找不到原因感到莫名其妙，後來請教了同學以及老師，原來是東西裝相反了才會導致球往後跳，改正完以後球就可以正常運作了。 \n \n', 'tags': '', 'url': '40623229-8.html'}, {'title': '40623232-8', 'text': '上週開始在研究bubbleRob，一開始我的球真的是直接閃掉，不誇張，因為我不太知道原因，所以我又再從頭再做一次，竟然這次就可以了，不過後面還是出現很多問題，最後透過同學的幫助。終於完成了最後的版本，太神拉 ! ! \n ./../downloads/RubbleRob-40623232.zip \n \n 第二次完成版本 \n \n \n 最終版本 \n \n \n', 'tags': '', 'url': '40623232-8.html'}, {'title': '40623242-8', 'text': '上週開始在研究bubbleRob，在第七週中一直搞不定不知道為啥球會滾到不行，直接解體，繼續加油，終於在第七週禮拜日完成了，但是到上課的時候給同組的同學看完了，才知道原來離完成還有很多的問題，透過同學的幫助，終於完成了最終版本，太讚啦！ \n 40623242 BubbleRob V-rep \n 最初的 \n \n 第一次完成版 \n \n 最終完成版本！！！！(因為我擺放圓柱的距離差很多，故我將sensor調大) \n \n', 'tags': '', 'url': '40623242-8.html'}, {'title': '40623243-8', 'text': '第八週接近期中考，已將Bubble Rob大致上完成，而還有遇到與同學類似的問題，就是數據及物品狀態都已設定無誤，但是感測到牆壁有反應可是不會後退，還在尋找方法解決，其他部分都已完成，像是速度，鏡頭，各種外觀狀態設定等等，都是沒有問題的，到期中考之前，須將其他未完成的部分補齊，並給自評及組員互評，必須盡快完成 \n', 'tags': '', 'url': '40623243-8.html'}, {'title': '40623244-8', 'text': '這週做的是如何將繪製好的組合圖在V-rep上建模，在Onshape上繪製好圖後，把檔案輸出成.stl，用V-rep打開檔案，但是在把組合件分開時，一直無法像說明當中那麼順利分開，失敗好多次，仍然不曉得錯在哪裡。後來跟同組組員討論後，才發現在組合零件時，不可以緊貼在一起，要有些許的縫隙，才能在V-rep中分成一件一件的零件。 \n Onsahpe圖檔： robotic manipulator \n', 'tags': '', 'url': '40623244-8.html'}, {'title': '40623248-8', 'text': 'clean model \n', 'tags': '', 'url': '40623248-8.html'}, {'title': '40423220-8', 'text': '這週是第8週,經過老師講解協同產品設計流程的教育目標,網路的環境日新月異,進步的非常快,如果不能努力透過網路學習,很快就會落後於那些努力專研的人。並且使用v-rep去分解已經組裝好的零件,但是有點難度,並沒有完成。 \n', 'tags': '', 'url': '40423220-8.html'}, {'title': '20190419 week9', 'text': '40623201-9 \n 40623204-9 \n 40623217-9 \n 40623223-9 \n 40623229-9 \n 40623232-9 \n 40623242-9 \n 40623243-9 \n 40623244-9 \n 40623248-9 \n 40423220-9 \n', 'tags': '', 'url': '20190419 week9.html'}, {'title': '40623201-9', 'text': '', 'tags': '', 'url': '40623201-9.html'}, {'title': '40623204-9', 'text': '', 'tags': '', 'url': '40623204-9.html'}, {'title': '40623217-9', 'text': '這星期期中考周，要上台報告，我還滿緊張可能要被酸，但似乎老師也有點聽不下去了，最後也是聽一聽或是看一看就直接問自評分數，接著下台，看來經歷了幾個班級的報告，是老師也扛不住的，畢竟也是有人會當混子，可能老師只是覺得太混不是很想說也說不定，至於我的報告，真的很意外的是老師竟然沒問我甚麼問題，令我挺驚訝的，或許可能該有的東西有呈現出來，就沒有多問我也說不定。 \n 期中自評成績: 70 \n 證明網址: \n https://www.youtube.com/watch?v=CwPbQCqIA3Q&feature=youtu.be \n \n', 'tags': '', 'url': '40623217-9.html'}, {'title': '40623223-9', 'text': '這周為期中考週,因為要自行拍攝影片並上台報告,所以先行製作了要用投影片,也把一些之其沒有打完的每週心得打完,不過東西好像還是有點少就是了 \n https://mdecadp2018.github.io/site-40623223/reveal/#/10 \n', 'tags': '', 'url': '40623223-9.html'}, {'title': '40623229-9', 'text': '這週老師指派了實習任務三給我們參考，以及實際的打開程式操作，還在摸索當中。 \n', 'tags': '', 'url': '40623229-9.html'}, {'title': '40623232-9', 'text': '', 'tags': '', 'url': '40623232-9.html'}, {'title': '40623242-9', 'text': '第三個的實習任務，看完裡面的tutorial是希望將物件可透過V-rep內部的CAD可接收的內建中轉入到V-rep，但有許多限定的要求，用STL的檔件丟入到V-rep的進行轉換模擬，V-rep會將圖檔轉換成好幾千甚至上萬種類的三角形，為了做CAE方面的分析，當超過20000個上限時有造成無法啟動甚至是不給予支援。 \n 期中考是該展現各位的東西了~加油！ \n', 'tags': '', 'url': '40623242-9.html'}, {'title': '40623243-9', 'text': '', 'tags': '', 'url': '40623243-9.html'}, {'title': '40623244-9', 'text': '', 'tags': '', 'url': '40623244-9.html'}, {'title': '40623248-9', 'text': '', 'tags': '', 'url': '40623248-9.html'}, {'title': '40423220-9', 'text': '', 'tags': '', 'url': '40423220-9.html'}, {'title': '20190426 week10', 'text': '', 'tags': '', 'url': '20190426 week10.html'}, {'title': '40623201-10', 'text': '', 'tags': '', 'url': '40623201-10.html'}, {'title': '40623204-10', 'text': '', 'tags': '', 'url': '40623204-10.html'}, {'title': '40623217-10', 'text': '這個星期我將之前的tutorial的製作過程用影片的方式呈現，那再重新的操作後，會覺得更能了解這些教程主要的應用重點在那些，以球的的主要做動除了程式，還有函數運算，物體的測量跟碰撞，以及做動順暢，還有感測器的設定紅色區塊表示感測到的範圍，則藍色區塊指消除紅色區域範圍且無效此區域範圍的效應，那除此之外這周有試著做看看第三實習任務，我是將零件組合後，並錄成影片，但似乎在後面還要再讓它可以順利做動且連結某些物件可一連串的行動，還有虛擬主機的部分，目前影片看完是覺得，假如真的能用電腦驅動程式並控制物體，我想這必須要硬體上的了解以及軟體上的應用，必須軟硬通吃才可能達到物聯網的效果，可是以目前我這狀態要學是真的天方夜譚。 \n onshape:\xa0 https://cad.onshape.com/documents/84337fdabe99aad24937c7a8/w/f3bc7c389c2aea591e2ae9bb/e/3485d3b12235016072d7523a \n 操作影片:\xa0 https://www.youtube.com/watch?v=0DXHADGwYJo&t=29s \n https://www.youtube.com/watch?v=-U-x7uPzyTY&feature=youtu.be \n \n \n', 'tags': '', 'url': '40623217-10.html'}, {'title': '40623223-10', 'text': '', 'tags': '', 'url': '40623223-10.html'}, {'title': '40623229-10', 'text': '', 'tags': '', 'url': '40623229-10.html'}, {'title': '40623232-10', 'text': '', 'tags': '', 'url': '40623232-10.html'}, {'title': '40623242-10', 'text': '', 'tags': '', 'url': '40623242-10.html'}, {'title': '40623243-10', 'text': '', 'tags': '', 'url': '40623243-10.html'}, {'title': '40623244-10', 'text': '', 'tags': '', 'url': '40623244-10.html'}, {'title': '40623248-10', 'text': '', 'tags': '', 'url': '40623248-10.html'}, {'title': '40423220-10', 'text': '', 'tags': '', 'url': '40423220-10.html'}, {'title': '20190503 week11', 'text': '', 'tags': '', 'url': '20190503 week11.html'}, {'title': '40623201-11', 'text': '', 'tags': '', 'url': '40623201-11.html'}, {'title': '40623204-11', 'text': '', 'tags': '', 'url': '40623204-11.html'}, {'title': '40623217-11', 'text': '', 'tags': '', 'url': '40623217-11.html'}, {'title': '40623223-11', 'text': '', 'tags': '', 'url': '40623223-11.html'}, {'title': '40623229-11', 'text': '', 'tags': '', 'url': '40623229-11.html'}, {'title': '40623232-11', 'text': '', 'tags': '', 'url': '40623232-11.html'}, {'title': '40623242-11', 'text': '', 'tags': '', 'url': '40623242-11.html'}, {'title': '40623243-11', 'text': '', 'tags': '', 'url': '40623243-11.html'}, {'title': '40623244-11', 'text': '', 'tags': '', 'url': '40623244-11.html'}, {'title': '40623248-11', 'text': '', 'tags': '', 'url': '40623248-11.html'}, {'title': '40423220-11', 'text': '', 'tags': '', 'url': '40423220-11.html'}, {'title': 'Midterm Report', 'text': '', 'tags': '', 'url': 'Midterm Report.html'}, {'title': '40623201', 'text': '\n', 'tags': '', 'url': '40623201.html'}, {'title': '40623204', 'text': '\n', 'tags': '', 'url': '40623204.html'}, {'title': '40623217', 'text': '影片:\xa0 https://www.youtube.com/watch?v=CwPbQCqIA3Q&feature=youtu.be \n \n', 'tags': '', 'url': '40623217.html'}, {'title': '40623223', 'text': '\n', 'tags': '', 'url': '40623223.html'}, {'title': '40623229', 'text': '\n', 'tags': '', 'url': '40623229.html'}, {'title': '40623232', 'text': '\n', 'tags': '', 'url': '40623232.html'}, {'title': '40623242', 'text': '\n', 'tags': '', 'url': '40623242.html'}, {'title': '40623243', 'text': '\n', 'tags': '', 'url': '40623243.html'}, {'title': '40623244', 'text': '期中影片: \n', 'tags': '', 'url': '40623244.html'}, {'title': '40623248', 'text': '期中影片 \n \n', 'tags': '', 'url': '40623248.html'}, {'title': '40423220', 'text': '\n \n', 'tags': '', 'url': '40423220.html'}]};